$(function(){$(".carousel").slick({infinite:!0,autoplay:!0,speed:1e3,autoplaySpeed:2e3,slidesToShow:1,slidesToScroll:1,arrows:!0,dots:!0})}),$(function(){$(window).on("resize",function(evt){$("img",".carousel").each(function(){var $this=$(this);$(window).width()<700?$this.data("poster")&&$this.attr("src",$this.data("poster")):$this.data("default")&&$this.attr("src",$this.data("default"))})}),$(window).resize()}),$(function(){$('a[href*="#"]:not([href="#"])').click(function(){if(location.pathname.replace(/^\//,"")==this.pathname.replace(/^\//,"")&&location.hostname==this.hostname){var target=$(this.hash);if(console.log(target),target.length)return $("html, body").animate({scrollTop:target.offset().top},1e3),!1}})});